      </h3>

    </body>
  )
}



class MyApp extends React.Component {
  state = {
    characters: [{name:'Charlie' , weight:36 }, {name : 'Jason', weight:50} ,{name :'Hank', weight:72} ],
  }

  render() {
    return (
      <div className="container">
        <TableBody />
      </div>
    )
  }
}

export default MyApp;
